Mongojack: invalid hexadecimal representation of an ObjectId<h1>Goal</h1>
<p>I am trying to push some data to a mongo db using <a href="https://mongojack.org" rel="nofollow noreferrer">mongojack</a>.
I expect the result to be something like this in the db:</p>
<pre><code>{
 &quot;_id&quot;: &quot;840617013772681266&quot;,
 &quot;messageCount&quot;: 69420,
 &quot;seedCount&quot;: 18,
 &quot;prefix&quot;: &quot;f!&quot;,
 &quot;language&quot;: &quot;en&quot;
}
</code></pre>
<h1>Problem</h1>
<p>Instead, I get this error in my console.</p>
<pre><code>Caused by: java.lang.IllegalArgumentException: invalid hexadecimal representation of an ObjectId: [840617013772681266]
    at org.bson.types.ObjectId.parseHexString(ObjectId.java:390)
    at org.bson.types.ObjectId.&lt;init&gt;(ObjectId.java:193)
    at org.mongojack.internal.ObjectIdSerializer.serialiseObject(ObjectIdSerializer.java:66)
    at org.mongojack.internal.ObjectIdSerializer.serialize(ObjectIdSerializer.java:49)
    at com.fasterxml.jackson.databind.ser.BeanPropertyWriter.serializeAsField(BeanPropertyWriter.java:728)
    at com.fasterxml.jackson.databind.ser.std.BeanSerializerBase.serializeFields(BeanSerializerBase.java:770)
    ... 59 more
</code></pre>
<h1>Code</h1>
<p>This is the code that gets called when I try to create a new Guild in the db:</p>
<pre><code>    public static Guild getGuild(String id) throws ExecutionException {
        return cache.get(id);
    }
</code></pre>
<p><code>cache</code> is the following (load get executed):</p>
<pre><code>    private static LoadingCache&lt;String, Guild&gt; cache = CacheBuilder.newBuilder()
            .expireAfterAccess(10, TimeUnit.MINUTES)
            .build(
                    new CacheLoader&lt;&gt;() {
                        @Override
                        public Guild load(@NotNull String id) {
                            return findGuild(id).orElseGet(() -&gt; new Guild(id, &quot;f!&quot;));
                        }
                    });
</code></pre>
<p>The <code>findGuild</code> method that gets called first:</p>
<pre><code>    public static Optional&lt;Guild&gt; findGuild(String id) {
        return Optional.ofNullable(guildCollection.find()
                .filter(Filters.eq(&quot;_id&quot;, id)).first());
    }
</code></pre>
<p>And finally the <code>Guild</code> document.</p>
<pre><code>@Getter
@Setter
public class Guild implements Model {

    public Guild(String id, String prefix) {
        this.id = id;
        this.prefix = prefix;
    }

    public Guild() {
    }

    private String id;

    /*
    If a Discord guild sent 1,000,000,000 messages per second,
    it would take roughly 292471 years to reach the long primitive limit.
     */
    private long messageCount;

    private long seedCount;

    // The default language is specified in BotValues.java's bot.yaml.
    private String language;

    private String prefix;

    @ObjectId
    @JsonProperty(&quot;_id&quot;)
    public String getId() {
        return id;
    }

    @ObjectId
    @JsonProperty(&quot;_id&quot;)
    public void setId(String id) {
        this.id = id;
    }
}
</code></pre>
<h1>What I've tried</h1>
<p>I've tried multiple things, such as doing <code>Long.toHexString(Long.parseLong(id))</code> truth is I don't understand the error completely and after seeing <a href="https://docs.mongodb.com/manual/reference/method/ObjectId/" rel="nofollow noreferrer">documentation</a> I'm left with more questions than answers.</p>

