Paginate MongoDB aggregation response<p>I have a database of users that have skills. I have set up a way to find users in the database using am aggregation method included in mongoose. Depending on the search criteria I input into the aggregation, the results may be too big to actually display on my front end app. I am curious how I can paginate an aggregation query with the typical limit, page, and skip variables like you would do in a typical GET request.</p>
<p>Here is my aggregation query:</p>
<pre><code>const foundUsers = await User.aggregate([
{
  $addFields: {
    matchingSkills: {
      $filter: {
        input: '$skills',
        cond: {
          $or: test,
        },
      },
    },
    requiredSkills,
  },
},
{
  $addFields: {
    // matchingSkills: '$$REMOVE',
    percentageMatch: {
      $multiply: [
        { $divide: [{ $size: '$matchingSkills' }, skillSearch.length] }, // yu already know how many values you need to pass, thats' why `2`
        100,
      ],
    },
  },
},
{
  $addFields: {
    matchingSkillsNames: {
      $map: {
        input: '$matchingSkills',
        as: 'matchingSkill',
        in: '$$matchingSkill.skill',
      },
    },
  },
},
{
  $addFields: {
    missingSkills: {
      $filter: {
        input: '$requiredSkills',
        cond: {
          $not: {
            $in: ['$$this', '$matchingSkillsNames'],
          },
        },
      },
    },
  },
},
{
  $match: { percentageMatch: { $gte: 25 } },
},
]);
</code></pre>
